// imports
import 'package:svelte/svelte.dart';

// properties
external int count = 0;

// body
$: doubled = count * 2;
$: quadrupled = doubled * 2;

void handleClick() {
  count += 1;
}

const duration = Duration(seconds: 1);

onMount(() {
  var timer = Timer.periodic(duration, (_) {
    count += 1;
  });

  return () {
    timer.cancel();
  };
});
